# -*- coding: utf-8 -*-

from __future__ import unicode_literals

#1- Importation des modules
import streamlit as st
import streamlit.components.v1 as components
import time
from pyautogui import*
from PIL import Image


#2- Initialisation de la coniguration de l'app
## Importation du logo de l'app avec Pillow
logo=Image.open("logo_GE.png")

##initialisation du titre de la page et du flavicon
st.set_page_config(page_title="streamlit splashscreen",layout="wide",page_icon=logo)
width,height=size()


#3- Creation des pages de l'app
##3-1...................Creation de la splashscreen
splash_html="""
<html lang="en">
<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <style>
    	/*-- Le code CSS est ici--*/
		.logo{
		    display: flex;
		    width: 150px;
		    height: 52px;
		    color: white;

		}
		.ecran-chargement{
		    display: flex;
		    align-items: center;
		    justify-content: center;
		    text-align: center;
		    position: fixed;
		    top: 0;
		    left: 0;
		    height: 100vh;
		    width: 100%;
		    background: black;
		}
		.bar_chargement{
		    width: 150px;
		    height: 2px;
		    position: relative;
		    overflow: hidden;
		    background: #cfcfcf;
		    margin-top: 22px;
		}
		.bar_chargement::before{
		    content: "";
		    width: 75px;
		    height: 2px;
		    position: absolute;
		    left: -34px;
		    background: #0073b1;  
		    animation: animation_bar 1.0s infinite ease;
		}

		/*-- creation de l'animation css--*/
		@keyframes animation_bar {
		    50%{
		        left: 100px;
		    }
		}
</style>
</head>
<body>

    <!--Div de la fenetre de chargement -->
    <div class="ecran-chargement">
        <div class="animation_chargement">
         <!--Le code SVG du logo ici -->
            <svg
				 xmlns="http://www.w3.org/2000/svg"
				 xmlns:xlink="http://www.w3.org/1999/xlink"
				 width="148px" height="125px">
				<image  x="0px" y="0px" width="148px" height="125px"  xlink:href="data:img/png;base64," />
			</svg>
            <div class="bar_chargement"></div>
        </div>
    </div>

</body>
</html>
"""

# creation d'un placeholder pour le splashscreen
espace_splash=st.empty()
with espace_splash:
    components.html(
        splash_html,
        height=height-60*height/100,
        )

# attendre 5 seconde et effacer le placeholder du splashscreen
time.sleep(5)
espace_splash.empty()

##3-2...................Creation de la page principale
st.write("# Bienvenue")
st.sidebar.markdown(
"""	<center><h1>Menu</h1></center>
	<center>
	     <svg
	     xmlns="http://www.w3.org/2000/svg"
	     xmlns:xlink="http://www.w3.org/1999/xlink"
	     width="72px" height="60px">
	    <image  x="0px" y="0px" width="72px" height="60px"  xlink:href="data:img/png;base64," />
	    </svg>   
	</center>
""",unsafe_allow_html=True)